import { VALIDATE_INCOME } from "../actions/action-types";


const incomeErrors = {
    errCount: 0,
    income: null
}


export default function incomeErrorReducer(state = incomeErrors, action) {
    switch( action.type ) {
        case VALIDATE_INCOME: 
            return action.payload 

        default:
            return state;
    }
};
